                        <Button>REGISTER</Button>
                    </Box>
                </Box>
            </Box>
            <Box sx={{ width: '100%', display: 'flex'}} >
                <Box sx={{backgroundColor: "white"}}>
                    <Typography sx={{color: 'white'}}>WANT TO LEARN MORE?</Typography>
                    <Stack>
                        <Button>WHAT IS PICKLEBALL?</Button>
                        <Button>SIGN UP</Button>
